import React, { useState } from 'react';
import { BrowserRouter as Router, Switch, Route, Redirect } from 'react-router-dom';
import './App.css';
import Login from './components/Login';
import MainContent from './MainContent';
import PredictionPage from './components/PredictionPage';  // Import the PredictionPage component

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [predictionData, setPredictionData] = useState(null);

  // Callback function to set the user as logged in
  const handleLogin = () => {
    setIsLoggedIn(true);
  };

  // Callback function to set the user as logged out
  const handleLogout = () => {
    const confirmLogout = window.confirm('Are you sure you want to logout?');
    if (confirmLogout) {
      setIsLoggedIn(false);
    }
  };

  // Callback function to set the prediction data
  const handlePrediction = (data) => {
    setPredictionData(data);
  };

  return (
    <Router>
      <div className="app">
        {isLoggedIn && (
          <div className="logout-button" onClick={handleLogout}>
            Logout
          </div>
        )}

        <div className="content">
          <Switch>
            <Route path="/login">
              {isLoggedIn ? <Redirect to="/" /> : <Login onLogin={handleLogin} />}
            </Route>
            <Route path="/" exact>
              {isLoggedIn ? <MainContent onPrediction={handlePrediction} /> : <Redirect to="/login" />}
            </Route>
            <Route path="/prediction">
              {isLoggedIn ? <PredictionPage predictionData={predictionData} /> : <Redirect to="/login" />}
            </Route>
          </Switch>
        </div>
      </div>
    </Router>
  );
}

export default App;
